import React from "react";
import Navigation from "./components/Navigation";
import AuthLogin from "./components/AuthLogin";
import Board from "./components/Board";
import LiveClock from "./LiveClock";

function App() {
  return (
    <>
      <LiveClock />
      <br />
      <AuthLogin />
      <br />
      <Board />
    </>
  );
}

export default App;
